export default [
  { id: 1, name: "Football", icon: "Football" },
  { id: 2, name: "Basketball", icon: "Basketball" },
  { id: 3, name: "Volleyball", icon: "Volleyball" },
  { id: 4, name: "Table Tennis", icon: "TableTennis" },
  { id: 5, name: "Badminton", icon: "Badminton" },
  { id: 6, name: "Boxing", icon: "Box" },
  // ...add more as needed
];
